import { ADD_USER_ASYNC, ADD_USER } from "./constant";

function userDataReducer(state, action) {
  switch (action.type) {
    case ADD_USER:
      console.log(action,state,"bbbbbbbbbbbbbb")
      const data1 = state && state.value && state.value.data && state.value.data.results
      return Object.assign({}, state, {
        users: [...data1, action.user]
      });
    default:
      return state;
  }
}

export default userDataReducer;
